import React, { useState, useEffect } from "react";
import "./App.css";
import environment from "./environments/environment";

//Components
import Header from "./components/header";
import Footer from "./components/footer";
import Card from "./components/card";

function App(props) {
  const [subscribers, setSubcribers] = useState([]);

  useEffect(() => {
    const subscribersUrl = environment.serverUrl;
    async function getSubscribers() {
      const response = await fetch(subscribersUrl);
      const subscribersData = await response.json();
      setSubcribers(subscribersData);
      console.log(subscribersData);
    }
    getSubscribers();
    return;
  }, []);

  return (
    <div className='App'>
      <Header />
      <div>
        <table>
          <tr>
            <th>
              <td>
                <h4>Name</h4>
              </td>
            </th>
            <th>
              <td>
                <h4>LastName</h4>
              </td>
            </th>
            <th>
              <td>
                <h4>Age</h4>
              </td>
            </th>
            <th>
              <td>
                <h4>Sport</h4>
              </td>
            </th>
          </tr>
          <tr>
            {subscribers.map(subscriber => {
              return (
                <div key={subscriber.id}>
                  <td>
                    <p>{subscriber.name}</p>
                  </td>
                  <td>{subscriber.lastName}</td>
                  <td>{subscriber.age}</td>
                  <td>{subscriber.sport}</td>
                </div>
              );
            })}
          </tr>
        </table>
      </div>
      <Card />
      <Footer />
    </div>
  );
}

export default App;
